DROP TABLE address_book_test;

CREATE TABLE address_book_test (
  id   INTEGER PRIMARY KEY AUTOINCREMENT,
  icon TEXT,
  last_name TEXT,
  first_name TEXT,
  nick_name TEXT,
  tel  TEXT,
  zip  TEXT,
  pref TEXT,
  city TEXT,
  below1 TEXT,
  below2 TEXT,
  mail TEXT,
  delete_flag INTEGER,
  create_on TEXT,
  modify_on TEXT
);


